import img from './doc.jpg';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col'; 
import Container from 'react-bootstrap/Container';
import { AiOutlineInstagram , AiOutlineFacebook, AiFillTwitterCircle, AiFillLinkedin} from "react-icons/ai";      


function Home1() {
  return (
    <Container>

        <Col style={{}}>
            <Row>

            <img src={img}  width="300" height="300"  style={{verticalAlign:"top", position:"center", marginTop:"100px"}}/>
            </Row>
            <Row>
                {/* <Typography variant="h3"  gutterBottom style={{fontFamily: 'Roboto Slab'}}> */}
                    DR. BHARATH KUMAR B

                {/* </Typography>
                <Typography variant="h5"  gutterBottom style={{fontFamily: 'Roboto Slab'}}> */}
                    <i>MBBS, PGDSM (Sports Medicine)</i>
                {/* </Typography> */}
            </Row>
            <br/>
            <Row>
            <AiOutlineInstagram size="40"/>
            <AiOutlineFacebook size="40"/>
            <AiFillTwitterCircle size="40"/>
            <AiFillLinkedin size="40"/>

            </Row>
        </Col>

        <hr/>

        <div className="row">
            <div className="col-2">upload file :
            &nbsp;
            </div>
            <div className="col-4">
            <input type="file"/>
            </div>

            <div className="col-3 text-center pull-left">
                <div style={{ borderWidth: 1, height: 25, backgroundColor: '#ccc', width: 1, marginLeft: 'auto', marginRight: 'auto' }}></div>
                    OR
                <div style={{ borderWidth: 1, height: 25, backgroundColor: '#ccc', width: 1, marginLeft: 'auto', marginRight: 'auto' }}></div>
            </div>
            <div className="col-2"><a href="">Write code in IDE</a>

            </div>
        </div>




    </Container>  


  );
}

export default Home1;
